            {
                    xt = this.name.replace(/^.*\./,"").toLowerCase();
                    tp = File.TYPES_BY_EXTENSION[xt] || 7;
                    nm = File.CATEGORIES[tp].toLowerCase();
    
                    return nm;
            }

